/* Procedure structure for procedure `sp_book_borrow_get` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_book_borrow_get` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_book_borrow_get`(
	_type VARCHAR (50),
	_date_from datetime,
	_date_to datetime
)
BEGIN
	SELECT b.`title`,b.`author`,CONCAT(rb.`last_name`, ", ",rb.`first_name`, " ", UPPER(SUBSTRING(rb.`middle_name`,1,1)),".") AS `borrower`,
	bb.`barcode`,DATE_FORMAT(bb.`borrow_date`, "%M %d, %Y %h:%i %p") AS borrowed_on,DATE_FORMAT(bb.`return_date`,"%M %d, %Y %h:%i %p") AS returned_on, bb.borrower_id FROM `book_borrow` bb 
	JOIN `books` b ON b.`id` = bb.`book_id`
	JOIN `registered_borrowers` rb ON rb.`id` = bb.`borrower_id`
	WHERE rb.`type` = _type AND bb.`borrow_date` BETWEEN _date_from AND _date_to;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_book_deac` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_book_deac` */;

